991840e829f41ae033ed447f3eab7481f7faa96d:
query MainnetMints($first: Int, $skip: Int, $orderDirection: OrderDirection) {
  transfers(
    first: $first
    skip: $skip
    orderDirection: $orderDirection
    where: {from: "0x0000000000000000000000000000000000000000"}
  ) {
    FameLadySociety_id
    blockNumber
    blockTimestamp
  }
}

query MainnetOwners($first: Int, $skip: Int) {
  ownerships(first: $first, skip: $skip) {
    tokenId
    owner
  }
}

65df89bea7ccbe43bd45527a619de6bb1573e6d3:
query SepoliaTokenByOwner($owner: Bytes!, $first: Int, $skip: Int, $orderDirection: OrderDirection) {
  sepolia_ownerships(
    where: {owner: $owner}
    first: $first
    skip: $skip
    orderDirection: $orderDirection
  ) {
    tokenId
  }
}

